import React from "react";
import {

  Media,
  About,
  Bio,
} from "./containers";
import { Join, Brand, Navbar } from "./components";

import "./App.css";

const App = () => (
  <div className="App">
    <div className="gradient__bg">

      <Bio />
    </div>

    <About />

    <div className="gradient__bg">
    <Media />
    </div>

    <Join />


    <div className="gradient__bg_2">
      <Brand />
    </div>

  </div>
);

export default App;
